(1,'Regular English Program','Nuestro programa de Ingls est fundamentado en los estndares del Marco de Referencia Europeo, trabajamos con funciones comunicativas evocando contextos reales y experiencias funcionales de aprendizaje, a la par de encuentros interactivos con otros aprendices y hablantes nativos.','synchronous','images/courses/covers/regular_english_program.jpeg','2021-11-27 14:48:06','2021-11-27 14:48:06',NULL),
