(3,'Regular Spanish Program','Nuestro programa en lnea de espaol esta basado en los estndares del Marco de Referencia Europeo. El programa busca ayudar a los aprendices a comunicarse y desarrollar destrezas en contextos reales hacindoles vivir experiencias de aprendizaje asertivas y con propsito en sus lecciones, a travs del desarrollo de tareas y encuentros interactivos con otros aprendices y nativo hablantes.','synchronous','images/courses/covers/regular_spanish_program.jpeg','2021-11-27 14:48:06','2021-11-27 14:48:06',NULL),
(4,'Conversational Spanish Program','Clases con entornos totalmente personalizados, enfocadas en la necesidad especfica de cada estudiante y en desarrollo de sus destrezas comunicativas. Adems de las clases regulares, este paquete incluye otras prcticas conversacionales donde el estudiante interacta con otros aprendices y nativo hablantes.','synchronous','images/courses/covers/conversational_spanish_program.jpeg','2021-11-27 14:48:06','2021-11-27 14:48:06',NULL),
(5,'English Pronunciation Course','El curso de Introduccin a la Pronunciacin presentar una amplia gama de sonidos del ingls profundizando en los patrones que podemos detectar en las letras vocales. Los sonidos voclicos, sus entornos, las grafas entre otros aspectos sern estudiados en profundidad en este curso. Adems, habr prcticas y pruebas para evaluar tu proceso de aprendizaje.','asynchronous','images/courses/covers/english_pronunciation_course.jpeg','2021-11-27 14:48:06','2023-02-01 05:50:03',NULL),
(6,'English Grammar Course','Este curso pretende capacitarte para que seas capaz de identificar, analizar y manejar algunos puntos clave del sistema interno que rige el lenguaje. Adems, profundizaremos en el enfoque prctico para que aprendas a utilizar lo que aprenders.','asynchronous','images/courses/covers/english_grammar_course.jpeg','2021-11-27 14:48:06','2021-11-27 14:48:06',NULL),
